      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE - col0 BETWEEN col1 AND - col2 + + - col1 + + 56 * - - ( - col1 ) / col2 + - + ( + ( + - col2 ) ) * + - CAST ( + ( - col0 ) AS INTEGER ) + + col1;
  - name: tab0

outputs:
  - name: q4201.out
    data: |
